/*Table structure for table `bizinfo` */

DROP TABLE IF EXISTS `bizinfo`;

CREATE TABLE `bizinfo` (
  `id` int(4) NOT NULL auto_increment,
  `ECID` varchar(50) default NULL COMMENT 'EC企业代码',
  `OprCode` varchar(50) default NULL COMMENT '本业务信息的操作编码:02－终止：终止本业务；03－暂停：本业务暂停；04－恢复：恢复本业务05－变更',
  `OprSeq` varchar(50) default NULL COMMENT '本次操作的流水号',
  `OrdID` varchar(50) default NULL COMMENT '产品订购ID',
  `BizName` varchar(200) default NULL COMMENT '业务名称',
  `BizType` varchar(50) default NULL COMMENT '业务类型',
  `OrgProvID` varchar(50) default NULL COMMENT '主办省代码',
  `HomeCity` varchar(50) default NULL COMMENT '归属市代码',
  `SubBizType` varchar(50) default NULL COMMENT '子业务平台类型:00 通用01 出租车102 出租车203 公交04长途物流05 短途物流06大型活动(奥运)07铁路08长客09 混凝土10 海洋11 公安12 人员管理13 保险14 租赁15 导航16 石油17 危险品18 工商19 城管99其它',
  `BizStatus` varchar(50) default NULL COMMENT '业务状态:A-正常商用      S-内部测试      T-测试待审   R-试商用',
  `PayType` varchar(50) default NULL COMMENT '付费方式:0-个人付费；1-集团付费',
  `ProdOrdMod` varchar(50) default NULL COMMENT '产品受理付费模式:1-有限公司受理，一点支付  2-有限公司受理，分省支付   3-主办省受理，一点支付  4-主办省受理，分省支付   5-本省受理，本省支付',
  `OprEffTime` varchar(50) default NULL COMMENT '操作生效时间',
  `NetType` varchar(50) default NULL COMMENT '网络类型',
  `UsageDesc` varchar(512) default NULL COMMENT '业务使用方法描述',
  `IntroURL` varchar(200) default NULL COMMENT '业务的介绍网址',
  `AdminAcct` varchar(50) default NULL COMMENT '管理员账户',
  `AdminPasswd` varchar(100) default NULL COMMENT '管理员密码',
  `AdminMSISDN` varchar(50) default NULL COMMENT '管理员手机号',
  `LocPlatformType` varchar(50) default NULL COMMENT '成员定位组合方式:1-人员管理平台,2-人员和车辆混合管理平台',
  `tjtime` varchar(100) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

