/*Table structure for table `userinfo` */

DROP TABLE IF EXISTS `userinfo`;

CREATE TABLE `userinfo` (
  `id` int(4) NOT NULL auto_increment,
  `ECID` varchar(100) default NULL COMMENT 'EC代码',
  `OrdID` varchar(100) default NULL COMMENT '产品订购编码',
  `ProdName` varchar(256) default NULL COMMENT '业务名称',
  `OprSeq` varchar(100) default NULL COMMENT '流水号',
  `MSISDN` varchar(100) default NULL COMMENT '用户手机号码',
  `OprCode` varchar(100) default NULL COMMENT '03－定购  04－取消定购  05－暂停  06－恢复、08－变更 ',
  `PayECID` varchar(100) default NULL COMMENT '付费集团客户ID',
  `EfftT` varchar(100) default NULL COMMENT '用户希望的生效时间',
  `OprT` varchar(100) default NULL COMMENT 'LBMP操作时间',
  `LocType` varchar(100) default NULL COMMENT '定位方式:A－CellID  B－GPS  C－AGPS（终端侧）D－AGPS（网络侧）',
  `UEType` varchar(100) default NULL COMMENT '终端类型:1－人员 2－车辆',
  `UEID` varchar(100) default NULL COMMENT '终端ID',
  `UEModel` varchar(100) default NULL COMMENT '终端型号',
  `AutoNum` varchar(100) default NULL COMMENT '车牌号',
  `tjtime` varchar(100) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `userinfo` */

