/*Table structure for table `userstateinfo` */

DROP TABLE IF EXISTS `userstateinfo`;

CREATE TABLE `userstateinfo` (
  `id` int(4) NOT NULL auto_increment,
  `OrdID` varchar(100) default NULL COMMENT '产品订购编码',
  `MSISDN` varchar(100) default NULL COMMENT '用户手机号码',
  `Approbate` varchar(100) default NULL COMMENT '认证状态0：不需认证；1：未认证；2：等待认证；3：认证通过；4：认证失败',
  `OprT` varchar(100) default NULL COMMENT 'LBMP操作时间',
  `OprSeq` varchar(100) default NULL COMMENT '本次操作的流水',
  `tjtime` varchar(100) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

